import React from 'react';
import Badge from '@material-ui/core/Badge';
import MailIcon from '@material-ui/icons/Mail';
import Grid from '@material-ui/core/Grid';

const numbers = [
    1,
    5,
    7,
]

const colors = [
    'primary',
    'secondary',
    'error',
];

export default function BadgeExample() {
    return (
        <Grid 
            container 
        >
            {numbes.map((num, index) => {
                return (
                    <Grid 
                        key={index.toString()}
                        item
                        xs={4} 
                    >
                        <Badge 
                            badgeContent={num}
                            color={colors[index]}
                        >
                            <MailIcon />
                        </Badge>
                    </Grid>
                );
            })}
        </Grid>
    );
}
